*
 * 显示对话框
 *
 * 支持平台：书旗Android
 *
 * @return {Promise.<void>}
 *
 * @example
 * const params = {
 *   style: '1',
 *   title: '标题',
 *   content: '我是内容',
 *   okButton: '确定啦',
 *   cancelButton: '取消啦',
 * };
 * // const params = {
 * //   style: '2',
 * //   image: 'http://hellorfimg.zcool.cn/preview/293300162.jpg',
 * // };
 *
 * libSQ.exec('show-dialog', {
 *   params,
 * }).then((info) => {
 *   alert(`[show-dialog][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[show-dialog][error] ${JSON.stringify(err, null, 2)}`);
 * });

